    (1, 'Used Vehicles for sale in Fredericton near Saint John & Moncton. Best used cars available at Jim Gilbert\'s Wheels and Deals near Woodstock, Oromocto |  Used Cars Fredericton', X'', 1, 0, '2020 40 years, more than 20,000 customers, over a million hugs. Wheels and Deals is New Brunswick\'s number one car dealer selling the best used SUV\'s , used Trucks, used cars and mini vans', 'Used vehicles, Fredericton, New Brunswick', 'home', 0, 'navbar-light', 0, 1, 1, 0, '<style>\n.carousel-item {\n    margin-top: 2em;\n    height: 430px;\n}\n\n.carousel-indicators li {\n    width: 10px;\n    height: 10px;\n    border-radius: 100%;\n    color: red;\n}\n.carousel-indicators {\n    bottom: -50px;\n}\n\nol.carousel-indicators li,\nol.carousel-indicators li.active {\n  float: left;\n  width: 30px;\n  height: 10px;\n  margin: 0;\n  border-radius: 0;\n  border: 0;\n  background: silver;\n  margin-right: 0.25em;\n  z-index: 20009;\n}\n\nol.carousel-indicators li.active {\n  background: red;\n}\n</style>', '<div class=\"modal fade\" tabindex=\"-1\" role=\"dialog\" id=\"tempFinance\" style=\"z-index: 100002\">\n        <div class=\"modal-dialog modal-lg\" role=\"document\">\n            <div class=\"modal-content\">\n                <div class=\"modal-header\">\n                    <h5 class=\"modal-title\">Quick Click Inquiry</h5>\n                    <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\">\n                        <span aria-hidden=\"true\">&times;</span>\n                    </button>\n                </div>\n                <div class=\"modal-body\">\n\n                    <p>This Virtual thing is different but I understand....</p>\n\n                    <form id=\"tempForm\" class=\"needs-validation\" method=\"post\" action=\"/power-sports/quick-quote\"\n                          novalidate>\n                        <input type=\"hidden\" name=\"csrf_token\" value=\"KjWccxi7Ekmcjj9Dj57g0c2osxmfpXR5o7&#43;Lbc68Jd3wiEhgBOvPUBurepXxoyKUZHj6KzlrZxw&#43;&#43;7FbIB8nGg==\">\n                        <input type=\"hidden\" name=\"qq-vid\" id=\"temp-qq-vid\">\n\n                        <div class=\"form-group\">\n                            <label for=\"qq-name\">My name is:</label>\n                            <div class=\"input-group\">\n                                <div class=\"input-group-prepend\">\n                                    <span class=\"input-group-text\"><i class=\"fa fa-user fa-fw\"></i></span>\n                                </div>\n                                <input class=\"form-control required\"\n                                       id=\"temp-name\"\n                                       autocomplete=\"off\" type=\'text\'\n                                       name=\'name\' required>\n                                <div class=\"invalid-feedback\">\n                                    Required\n                                </div>\n                            </div>\n                        </div>\n\n                        <div class=\"form-group\">\n                            <label for=\"qq-email\">My email is:</label>\n                            <div class=\"input-group\">\n                                <div class=\"input-group-prepend\">\n                                    <span class=\"input-group-text\"><i class=\"fa fa-envelope fa-fw\"></i></span>\n                                </div>\n                                <input class=\"form-control required\"\n                                       id=\"temp-email\"\n                                       autocomplete=\"off\" type=\'email\'\n                                       name=\'email\' required>\n                                <div class=\"invalid-feedback\">\n                                    Please enter a valid email address\n                                </div>\n                            </div>\n                        </div>\n\n                        <div class=\"form-group\">\n                            <label for=\"qq-phone\">My number:</label>\n                            <div class=\"input-group\">\n                                <div class=\"input-group-prepend\">\n                                    <span class=\"input-group-text\"><i class=\"fa fa-phone fa-fw\"></i></span>\n                                </div>\n                                <input class=\"form-control required\"\n                                       id=\"temp-phone\"\n                                       autocomplete=\"off\" type=\'text\'\n                                       name=\'phone\'>\n                                <div class=\"invalid-feedback\">\n                                    Required\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"form-group\">\n                            <label for=\"qq-phone\">I would like to talk about:</label>\n                            <textarea id=\"talkabout\" class=\"form-control\" rows=\"3\"></textarea>\n                            <span id=\"interested-in-item\"></span>\n                        </div>\n                    </form>\n\n                </div>\n                <div class=\"modal-footer\">\n                    <button type=\"button\" class=\"btn btn-secondary\" data-dismiss=\"modal\">Cancel</button>\n                    <button type=\"button\" class=\"btn btn-primary\" data-dismiss=\"modal\"\n                            onclick=\"sendTempFinance()\">\n                        Click here\n                    </button>\n                </div>\n            </div>\n        </div>\n    </div>\n\n    <script>\n    function openTempFinance() {\n        $(\"#tempFinance\").modal({backdrop: false});\n    }\n\n\n    function sendTempFinance() {\n            let form = $(\"#tempForm\");\n            if (form[0].checkValidity() === false) {\n                this.event.preventDefault();\n                this.event.stopPropagation();\n            }\n            form.addClass(\'was-validated\');\n            if (form[0].checkValidity() === true) {\n                let formData = new FormData();\n                formData.append(\'name\', $(\"#temp-name\").val());\n                formData.append(\'email\', $(\"#temp-email\").val());\n                formData.append(\'phone\', $(\"#temp-phone\").val());\n                formData.append(\'interested\', $(\"#talkabout\").val());\n                formData.append(\'vehicle_id\', $(\"#temp-qq-vid\").val())\n                formData.append(\'csrf_token\', document.head.querySelector(\"meta[name=\'csrf-token\']\").content);\n                let ajax = new XMLHttpRequest();\n                ajax.responseType = \"json\";\n                ajax.open(\"POST\", \"/wheels/quick-quote\");\n                ajax.send(formData);\n                ajax.onreadystatechange = function () {\n                    if (ajax.readyState === 4) {\n                        $(\"#tempFinance\").modal(\'hide\');\n                        successAlert(\"Request sent!!\");\n                    }\n                }\n            }\n        }\n\n$(\"#quick-inquiry\").click(function(){\n    openTempFinance();\n})\n</script>\n\n', '', '2018-12-12 13:11:17', '2020-06-22 14:08:47', 0),
